  const handleLogin = () => {
    // Redirect the user to the backend login endpoint and send with JSON 
    window.location.href = 'http://127.0.0.1:5001/api/login';
  };



  //Should activate automatically after chat is done
  const handleTest = async () => {
    try {
      const response = await fetch('http://127.0.0.1:5001/api/post-queries', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
      });
      const data = await response.json();
      console.log(data);
    } catch (error) {
      console.error('Error:', error);
    }
  };






  return (


  <nav className="bg-gray-100 p-4">
    <div className="container mx-auto">
      <span className="text-xl font-bold">MOODIFX</span>
    </div>
  </nav>






  );
};

export default App;
